async function installSfx(target, token) {
    // @pcos-app-mode native
    await modules.users.mkrecursive(target + "/etc/sounds", token);
    await modules.fs.chmod(target + "/etc/sounds", "rx", token);
    await modules.fs.chown(target + "/etc/sounds", "root", token);
    await modules.fs.chgrp(target + "/etc/sounds", "root", token);
    await modules.fs.write(target + "/etc/sounds/ask.aud", "data:audio/mpeg;base64,", token);
    await modules.fs.write(target + "/etc/sounds/ding.aud", "data:audio/mpeg;base64,", token);
    await modules.fs.write(target + "/etc/sounds/error.aud", "data:audio/mpeg;base64,", token);
    await modules.fs.write(target + "/etc/sounds/shutdown.aud", "data:audio/mpeg;base64,", token);
    await modules.fs.write(target + "/etc/sounds/startup.aud", "data:audio/mpeg;base64,", token);
    await modules.fs.chmod(target + "/etc/sounds/ask.aud", "rx", token);
    await modules.fs.chmod(target + "/etc/sounds/ding.aud", "rx", token);
    await modules.fs.chmod(target + "/etc/sounds/error.aud", "rx", token);
    await modules.fs.chmod(target + "/etc/sounds/shutdown.aud", "rx", token);
    await modules.fs.chmod(target + "/etc/sounds/startup.aud", "rx", token);
    await modules.fs.chown(target + "/etc/sounds/ask.aud", "root", token);
    await modules.fs.chown(target + "/etc/sounds/ding.aud", "root", token);
    await modules.fs.chown(target + "/etc/sounds/error.aud", "root", token);
    await modules.fs.chown(target + "/etc/sounds/shutdown.aud", "root", token);
    await modules.fs.chown(target + "/etc/sounds/startup.aud", "root", token);
    await modules.fs.chgrp(target + "/etc/sounds/ask.aud", "root", token);
    await modules.fs.chgrp(target + "/etc/sounds/ding.aud", "root", token);
    await modules.fs.chgrp(target + "/etc/sounds/error.aud", "root", token);
    await modules.fs.chgrp(target + "/etc/sounds/shutdown.aud", "root", token);
    await modules.fs.chgrp(target + "/etc/sounds/startup.aud", "root", token);
}